import {Title} from './styleComps';
import styled from 'styled-components';
import {Link} from 'react-router-dom';

const Button = styled.button`
  display: inline-block;
  color: palevioletred;
  font-size: 1em;
  margin: 1em;
  padding: 0.25em 1em;
  border: 2px solid palevioletred;
  border-radius: 3px;
  display: block;
`;

const TomatoButton = () => {
    const types = {
        primary: "blue",
        warning: "yellow",
        error: "red"
    }
    const size = {
        big: "2em",
        small: "0.5em"
    }
    return styled(Button)`
      color: tomato;
      border-color: tomato;
      cursor: pointer;

      &:hover {
        color: blue
      };
      background: ${props => types[props.type]};
      size: ${props => size[props.size]};
    `;
}

function Home() {
    return (<>
        <Button href="/">link with button styles</Button>
        <TomatoButton href="/">link with tomato button styles</TomatoButton>
        <TomatoButton href="/" className="something">link with tomato button styles</TomatoButton>
    </>)
}

export default Home;
